import React from 'react';
import PropTypes from 'prop-types';
import { Container, Nav, NavItem, Navbar, NavbarBrand, NavbarCollapse } from 'react-bootstrap';

const mystyle = {
  color: "white",
  backgroundColor: "DodgerBlue",
  padding: "10px",
  fontFamily: "Arial"
};

export default function NavBar(props) {
  return (
    <Navbar expand="lg" className='bg-body-tertiary' >
      <Container fluid>
        <NavbarBrand>Vanesara</NavbarBrand>
        <Navbar.Toggle aria-controls='navbar-controller'>
          <Navbar.Collapse id='navbar-controller'>
            <Nav
              className="me-auto my-2 my-lg-0"
              style={{ maxHeight: '100px' }}
              navbarScroll
            >
              <NavItem>Hello</NavItem>

            </Nav>

          </Navbar.Collapse>
        </Navbar.Toggle>
      </Container>
    </Navbar>

  );
}
NavBar.propTypes = { applicationName: PropTypes.string, poweredByName: PropTypes.string.isRequired };
NavBar.defaultProps = { applicationName: "Application Name", poweredByName: "Company" };
